_____________________________________________

From: Darshatha Wijayasinghe 

Sent: Thursday, August 6, 2015 1:17 PM

To: #Leadership-Group-Leaders; #99X Support Management Team; #SL - Management Team; Dileepa Jayathilaka; Trudi Machado; Diyanthi Jayamanne; Buddhinatha Wijewantha

Cc: #StrategicGuidance

Subject: Transparency: Functional Area and Leadership Group
&nbsp;
&nbsp;
Hi Leadership Group Leads,
&nbsp;
Transparency, This is one aspect that we need to improve when we are working collaboratively towards a common Vision (The Winning Product).
&nbsp;
We need to be transparent on the 1) activities and 2) budgets of our Functional Areas and the Leadership Groups.
&nbsp;
Functional Area Heads/Representatives:
Please visit the Leadership Groups Page to get an idea about the Leadership Groups that are Connected to you.
Please communicate your plans and activities to your Leadership Groups.
Please communicate special financial budget allocations for a Leadership Group, to the Leader of that Leadership Group.
Try to be transparent on Financial Resource Utilization.
&nbsp;
Leadership Group Leads:
Please visit the Leadership Groups Page to get an idea about your Functional Area Contact Person.
Please communicate your plans and activities to your Functional Area Contact Person.
Please communicate your financial budget to the Functional Area Contact Person and Shehani. Get it approved.
Be transparent on Financial Resource Utilization.
&nbsp;
What is Transparency:
Transparency means that decisions taken and their enforcement are done in a manner that follows rules and regulations. It also means that information is freely available and directly accessible to those who
will be affected by such decisions and their enforcement. It also means that enough information is provided and that it is provided in easily understandable forms and media. [Reference]
&nbsp;
Thanks and regards,
Darshatha Wijayasinghe
Solutions Architect – Microsoft
